import React from "react";
import { Bar } from "react-chartjs-2";

const Histogram = () => {

  const data = {
    labels: ["1990", "1995", "2000", "2005", "2010", "2015", "2020"],
    datasets: [
      {
        label: "Number of Albums",
        backgroundColor: "#1DB954",
        borderColor: "#1DB954",
        borderWidth: 1,
        hoverBackgroundColor: "#1DB954",
        hoverBorderColor: "#1DB954",
        data: [10, 25, 50, 75, 100, 150, 200]
      }
    ]
  };

  return (
    <div>
      <h2>Histogram of Album Release Dates</h2>
      <Bar
        data={data}
        width={500}
        height={400}
        options={{
          maintainAspectRatio: false,
          scales: {
            yAxes: [
              {
                ticks: {
                  beginAtZero: true
                }
              }
            ]
          }
        }}
      />
    </div>
  );
};

export default Histogram;
